import React from "react";
import Chart from "../Chart/Chart";

const ExpensesChart = (props) => {
  const chartDataPoints = [
    { label: "Jan", value: 0 },
    { label: "Feb", value: 0 },
    { label: "Mar", value: 0 },
    { label: "Apr", value: 0 },
    { label: "May", value: 0 },
    { label: "Jun", value: 0 },
    { label: "Jul", value: 0 },
    { label: "Aug", value: 0 },
    { label: "Sep", value: 0 },
    { label: "Oct", value: 0 },
    { label: "Noc", value: 0 },
    { label: "Dec", value: 0 },
  ];

  for (const expense of props.expenses) {
    if (typeof expense.data == "undefined") {
      console.log("Found undefined value");
      console.log(props.expenses)
    } else {
      const expenseMonth = expense.data.getMonth(); // starting at 0 => January = 0
      chartDataPoints[expenseMonth].value += expense.amount;
    }
  }

  return <Chart dataPoints={chartDataPoints} />;
};

export default ExpensesChart;
